      <div className="Container">
        <Routes>
          <Route path="/home" element={<Home />} />
          <Route path="/prediction" element={<Prediction />} />
          <Route path="/treatmentoption" element={<TreatmentOption />} />
          <Route path="/aboutus" element={<AboutUs />} />
          <Route path="/contactus" element={<ContactUs />} />
        </Routes>
      </div>
      <div className="App">
        <div className="container">
          <div id="signInDiv"></div>
          {Object.keys(user).length !== 0 &&
            <button className="google-btn" onClick={(e) => handleSignOut(e)}>Sign Out</button>
          }
          {Object.keys(user).length !== 0 &&
            <div className="user-info-container">
              <div className="user-info">
                <img src={user.picture} alt="User Avatar" />
                <h3>{user.name}</h3>
              </div>
            </div>
          }
        </div>
      </div>
      <div style={styles.chatbotContainer}>
        {!minimized && (
          <ChatBot steps={steps} botAvatar="/botavatar.png" />
        )}
        <Button
          icon={minimized ? 'window maximize' : 'window minimize'}
          onClick={handleToggleMinimize}
          style={styles.minimizeButton} />
      </div>
    </>
  );
}

const styles = {
  chatbotContainer: {
    position: 'fixed',
    bottom: 20,
    right: 20,
    zIndex: 9999,
  },
  minimizeButton: {
    position: 'absolute',
    top: 0,
    right: 0,
    zIndex: 10000,
    height: '20px',
    width: '50px',
  },
};  

export default App;
